Bang Bus - Lucy Levon - The Monster Strikes Back - 

July 13, 2011 


in this weeks bangbus update were back with the crew but this time we brought out the homie ramon with us and as always the guy is hilarious!! the shit he says is so funny...any who on to the action were in the mean streets and we spot this little asian girl to find out she's actually from russia? any way she was real cool and didnt mind coming along with us as a matter of fact even her husband was cool with her joining us..so she comes with us and this girl was quite the act she was down for everything i threw at her and yes even the monster had his work cut out for himself lol..i hope u guys enjoy this update,Stay tuned!!
